  London (1969-72). He is also BA in Graphic Design from Kingston-on-Thames Art School (1973-76). Nigel
  is an advertising copywriter. He worked in London (1976-84), Edinburgh (1984-85) and Sydney (1985-).
  03> REED, Caroline Sarah m on 06.07.1985 to HILL, James Charles
  b 03.10.1953
  b 19.09.1942
  Caroline b. at Kaduna, Nigeria and m. at Corton (Boyton), Wilts, England. James, s/o Lance Charles Hill
  and Edith Margaret Skinner, b, at Melbourne, Australia. Address: 506 Hampton Street, Hampton 3188,
  Vic, Australia.
  Caroline graduated BSc (Microbiology) and MBBS, both from London University and was elected FRCPath and
  FRCPA. She worked as a doctor at Westminster Hospital in London before moving to Melbourne in 1993
  where she is Clinical Microbiologist at Dorovitch Pathology Laboratory.
  James graduated BArch from Melbourne University in 1964 then worked in Melbourne for five years and in
  London, England for 24 years before returning to Melbourne in 1993.
